package main

import "fmt"

func longestDupSubstring(s string) string {
  a := []int{}
  prev := map[rune]int{}
  for i, ch := range s {
    if n, f := prev[ch]; f && n >= 0 {
        a = append(a, n)
        prev[ch] = -1
    } else {
      prev[ch] = i
      continue
    }
    a = append(a, i)
  }
  
	solve := func(l int) string {
		m := map[string]int{}
		for _, i := range a{
      if i+l > len(s) {
        break
      }

			key := s[i : i+l]
			m[key]++
			if m[key] > 1 {
				return key
			}
		}

		return ""
	}

	res := ""
	l, r := 1, len(s)
	for l < r {
		mid := (l + r) >> 1 
		ans := solve(mid)

		if len(ans) > 0 {
			if len(ans) > len(res) {
				res = ans
        fmt.Println(len(ans))
			}
			l = mid + 1
		} else {
			r = mid 
		}
	}

	return res
}

func main() {
	var s string
	//fmt.Println(longestDupSubstring("banana"))
	s = "banana"
//	s = ""
	//s = ""
	  s = ""
	fmt.Println(longestDupSubstring(s))
}
